import React from 'react';
import { NavLink } from 'react-router-dom';

const SignedOutLinks = () => {
    return (
        <ul className="right">
            <li>
                <NavLink to="/signup">Sign Up</NavLink>
            </li>
            <li>
                <NavLink to="/signin">Login</NavLink>
            </li>
            <li>
                <NavLink to="/"> Projects</NavLink>
            </li>
        </ul>
    );
}

export default SignedOutLinks;
